CREATE TABLE `user_info` (
  `id` int(11) NOT NULL,
  `first_name` varchar(255) NOT NULL,
  `middle_name` varchar(255) DEFAULT NULL,
  `last_name` varchar(255) NOT NULL,
  `picture` longtext NOT NULL,
  `creds_id` int(11) DEFAULT NULL,
  `House/floor/bldgno.` varchar(255) NOT NULL,
  `Street` varchar(255) NOT NULL,
  `from` date NOT NULL,
  `to` date NOT NULL,
  `date_of_birth` date DEFAULT NULL,
  `Age` int(10) NOT NULL,
  `place_of_birth` varchar(255) NOT NULL,
  `contact_number` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `gender` varchar(255) NOT NULL,
  `civil_status` varchar(255) NOT NULL,
  `type_of_id` varchar(20) NOT NULL,
  `id_picture` longblob NOT NULL,
  `own_vehicle` varchar(24) NOT NULL,
  `vehicle_count` varchar(10) NOT NULL,
  `floor_count` varchar(10) NOT NULL,
  `time_Created` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `time_Updated` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

